    def  __init__(self, cube=None):
        self.state = Cube.solved if cube is None else cube.state

    def reset(self):
        self.state = Cube.solved

    def act(self, action):
        self.state = [self.state[i] for i in Cube.actions[action]]

    def algo(self, actions):
        for action in actions:
            self.act(action)

    def getState(self):
        return tuple(self.state)

    def setState(self, state):
        self.state = state

    def isSolved(self):
        return tuple(self.state) == Cube.solved

    def translate(self):
        state = [Cube.base_color[i] for i in self.state]
        state = [Cube.color_hot[i] for i in state]
        state = [item for sublist in state for item in sublist]
        return state

    def __repr__(self):
        return repr(self.state)

